import React from "react";

class Dashboard extends React.Component {
  /*componentDidMount() {
    var form = document.getElementById("formLogin");
    form.addEventListener("submit", event => {
      const email = document.getElementById("ed_email").value,
        password = document.getElementById("ed_password").value;

      console.log("email : ", email);
      console.log("password : ", password);
      event.preventDefault();
      fetch("http://localhost:3000/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/x-www-form-urlencoded"
        },
        body: `email=${email}&password=${password}`
      }).then(response => {
          console.log("Password is",response.ok)
      });
    });
  }*/

  render() {
    return (
      <main>
        <nav style={{display:"flex", width: "100%"}} className="nav">
          <div>
            <img src="static/src/Logo_petro.png" className="logo" />
          </div>
          <div style={{justifySelf: "flex-end"}}>
            <a href="../Login" className="login">Login</a>
            <a href="../DaftarBarang" className="daftarBarang">Daftar Barang</a>
            <a href="../Panduan" className="panduan">Panduan</a>
          </div>
        </nav>
        <style jsx global>{`
          body {
            background: #3ec400;
            font-family: "Open Sans", sans-serif;
            margin: 0 auto;
          }

          div {
            margin: 0 auto;
            display: block;
          }

          main {
            display: grid;
            grid-template-columns: 1fr 1fr;
            font-family: "Open Sans", sans-serif;
          }

          .logo{
              width: 80%;
              margin: 0;
              margin-left: 8%;
              margin-top: 5%;
          }

          .login{
              font-size: 25px;
              margin-left: 25%;
          }


        `}</style>
      </main>
    );
  }
}

export default Dashboard;
